	<style>
    body{
      margin: 0px;
    }
        h1{
                font-size: 127px;
        margin-top: 0px;
        margin-bottom: 0px;
        position: fixed;
        right: 0px;
        }

        h2{
            position: fixed;
            right: 0px;
            top: 120px;
            font-size: 81px;
            margin-top: 40px;
            color: blue;
        }

        table{
          position: fixed;
          right: 20px;
          font-size: 2em;
          border: 1px solid;
        }

        td{
          text-align: center;
        }

        th{
          padding-right: 10px;
          background-color: lightgray;
          text-align: right;
        }

        path
        {
          cursor: pointer;
        }

        .popBG
        {
          background-color: black;
          opacity: 0.72;
          position: absolute;
          height: 100vh;
          width: 100vw;
          
          z-index: 999999;
        }
        
        .hiddenTillShown{
          display: none;
        }

        .popBody{
          width: 50vw;
          height: 35%;
          background: white;
          opacity: 1;
          top: 50%;
          left: 50%;
          position: absolute;
          -ms-transform: translate(-50%, -50%);
          transform: translate(-50%, -50%);
          border-radius: 10px;
          z-index: 999999;
          font-family: sans-serif;
        }

        .popTitle{
          line-height: 30px;
          padding: 16px;
          font-size: 1.2em;
          font-weight: 500;
          font-family: sans-serif;
        }

        .popMessage{
          /* padding: 16px; */
          /* border: 1px solid; */
          width: 100%;
          text-align: center;
          /* line-height: 140px; */
          position: absolute;
          top: 45%;
          left: 50%;
          transform: translate(-50%, -50%);
          font-size: 4em;
          text-transform: capitalize;
        }

        .popBtnContainer{
          bottom: 0px;
          position: absolute;
          width: inherit;
          height: 70px;
          border-radius: 0 0 10px 10px;
          background-color: gainsboro;
          display: flex;
        }
        .popBtn{
          width: 50%;
          height: 100%;
          border: 1px solid;

          text-align: center;
          line-height: 70px;
          font-size: 2em;

          cursor: pointer;
        }

        .btnYes{
          background-color: lightgreen;
          border-radius: 0 0 0 10px;
        }

        .btnNo{
          background-color: lightsalmon;
          border-radius: 0 0 10px 0;
        }


        @media only screen and (max-width: 900px) {
          .popBody {
            width: 95vw;
          }

          .popMessage{
            font-size: 3em;
          }
        } 
    </style>
</head>

        <div class="popBtnContainer">
          <div class="popBtn btnYes" data="yes">Yes</div>
          <div class="popBtn btnNo" data="no">No</div>
        </div>
    </div>
  </div>
